import React, { Component } from "react";
import Slider from "react-slick";
// import './Trending.module.css'
// import "slick-carousel/slick/slick.css"; 
// import "slick-carousel/slick/slick-theme.css";
// import '../../static/css/_slick.css'
// import '../../static/css/_slickTheme.css'
import 'bootstrap/dist/css/bootstrap.min.css';
import { Button} from 'react-bootstrap'

export default class SimpleSlider extends Component {
  render() {
    const settings = {
      dots: true,
      infinite: true,
      fade: true,
      infinite: true,
      speed: 500,
      slidesToShow: 1,
      slidesToScroll: 1,
      className: 'slides',
      arrows: true
    }
    return (
      <div style={{width:'100%'}}>
        <h2> Single Item</h2>
        <Button primary>Click me</Button>
        <Slider {...settings}>
          <div>
            <img width="100%" src="https://images.unsplash.com/photo-1509592149237-bc44977d96d0?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=1051&q=80" alt="photo" />

          </div>
          <div>

            <img width="100%" src="https://images.unsplash.com/photo-1509592149237-bc44977d96d0?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=1051&q=80" alt="photo" />

          </div>
          <div>
            <img width="100%" src="https://images.unsplash.com/photo-1509592149237-bc44977d96d0?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=1051&q=80" alt="photo" />
          </div>
        </Slider>
      </div>
    );
  }
}
